import Login from './login';
import Register from './register';
import './App.css';

function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          {/* <Route path="/" exact element={<App/>} /> */}
          <Route path="/login" exact element={<Login/>} />
          <Route path="/register" exact element={<Register/>} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
